Mandan-Hidatsa storyteller and musician Keith Bear weaves a magic of story, song, history and personal reflection that enchants audiences of all ages. Reflecting the dignity and spiritual wisdom of his ancestors, he inspires reverence for the earth and all our relatives, gratitude for the diversity of human experience, and appreciation of the beauty of traditional Native American songs and stories, many of which have been shared for hundreds of years.

Keith Bear is an educator who works with students of all ages in school programs and residencies. He is an award-winning recording artist for Makoche Records who performs solo and ensemble concerts through the United States and Europe.
